import React from "react";
import "./Program.css"; // Import the CSS file for styling

// Define the array of programs dynamically
const programs = [
  { id: 1, title: "Python Developer", link: "https://forms.google.com/your-link" },
  { id: 2, title: "Java Developer", link: "https://forms.google.com/your-link" },
  { id: 3, title: "Web Designer", link: "https://forms.google.com/your-link" },
  { id: 4, title: "Data Analyst", link: "https://forms.google.com/your-link" },
  { id: 5, title: "AI/ML", link: "https://forms.google.com/your-link" },
  { id: 6, title: "Cybersecurity Expert", link: "https://forms.google.com/your-link" },
];

